import React from "react";
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.js";
// import GridItem from "components/Grid/GridItem.js";
import { Parallax, Background } from "react-parallax";
import styles from "assets/jss/material-kit-react/views/componentsSections/exampleStyle.js";

const useStyles = makeStyles(styles);

export default function SectionExamples() {
  const classes = useStyles();
  return (
    <div className={classes.section}>
      {/* <div className={classes.container}> */}
      {/* <GridContainer justify="center"> */}
        {/* <GridItem xs={12} sm={12} md={6}></GridItem>
          <GridItem xs={12} sm={12} md={6}></GridItem> */}
        <Parallax strength={500}>
          <Background className="custom-bg">
            <div
              style={{
                height: 2000,
                width: 2000,
                backgroundImage:
                  "url('https://thumbs.dreamstime.com/b/abstract-ink-fluid-marbled-texture-luxurious-granite-marble-mineral-pattern-wallpaper-black-white-minimalist-liquid-art-152635746.jpg')",
              }}
            />
          </Background>
          <div>
            <br />
            <br />
            <br />
            NEGAR BAKHSHI
            <br />
            <br />
            <br />
            <br />
          </div>
        </Parallax>
      {/* </GridContainer> */}
      <div style={{ height: 500 }}>{/* <h2>{"\u2728"}</h2> */}</div>
      {/* </div> */}
    </div>
  );
}
